class Solution {
  int minOperations(List<int> nums, int target) {
    Map<int, int> count = {};
    int ops = 0;
    int sum = 0;
    for (int num in nums) {
      count[num] = (count[num] ?? 0) + 1;
      sum += num;
    }
    if (sum < target) return -1;
    for (int i = 30; i >= 0; i--) {
      int val = 1 << i;
      while (target >= val && count[val] != null && count[val]! > 0) {
        target -= val;
        count[val] = count[val]! - 1;
      }
      if (target == 0) break;
      if (i > 0) {
        int needed = (target + val - 1) ~/ val;
        int available = count[val] ?? 0;
        int used = needed < available ? needed : available;
        target -= used * val;
        count[val] = available - used;
        count[val >> 1] = (count[val >> 1] ?? 0) + used * 2;
        ops += used;
      }
    }
    return target == 0 ? ops : -1;
  }
}
